      function initMap(mapEl) {
        vectorS= new VectorSource({
            wrapX: true,
          })
        const map = new olmap({
          target: mapEl, //挂载实例
          layers: [
            new layer.Tile({
              source: new source.XYZ({
                url: 'http://10.0.54.106:8080/windy/{z}/{x}/{y}.png', // 内网地址
                
              }),
            }),
            new VectorLayer({
              source: vectorS,
              name: 'Point',
            }) 
          ],
          view: new View({
            //地图视图
            center: [106, 35],
            projection: 'EPSG:4326',
            zoom: 5,
            wrapX: true,
          }), //地图设置
          controls: [], //取消地图操作
        })
        return map
      }

      let mapObj = null
      window.onload = function () {
        const mapEl = document.querySelector('#map')
        mapObj = initMap(mapEl)
        mapObj.once('postrender', function () {
          init()
        })
      }
  
      async function addLayer(lineGeojson) {
        let params = {
          // 图层配置
          colorRamp: [
            [500, 'rgba(0, 0, 255, 1)'], // 大蓝
            [510, 'rgba(20, 40, 255, 1)'], // 深蓝
            [520, 'rgba(50, 80, 255, 1)'], // 中蓝
            [530, 'rgba(255, 0, 0, 1)'], // 大红
            [540, 'rgba(255, 50, 50, 1)'], // 红
            [550, 'rgba(180, 0, 255, 1)'], // 大紫
            [560, 'rgba(150, 0, 180, 1)'], // 紫
            [570, 'rgba(100, 0, 140, 1)'], // 深紫

            [590, 'rgba(255, 105, 180, 1)'], // 熏衣草粉
          ],
          // 设置等值线样式
          lineStyle: {
            // 是否使用图例
            useColorRamp: false,
            color: 'rgba(0,0,200,0.2)',

            special: [
              {
                value:580,
                width:10,
                color:'#ffff00',
              },
              {
                value: 560,
                width: 5,
                color: '#ff0000',
              },
           
            ],
            //等值线值对应的字段
            textValue: 'level-value',
            //等值线值对应的颜色
            fontColor: '#ffffff',
            //等值线值对应的大小
            fontSize: 35,
            // 是否显示标签
            showLabel: true,
          },
          // 设置极值点样式
          extremeStyle: {
            // 是否使用图例
            // useColorRamp: false,
            // 是否显示标签
            showLabel: true,
            textValue: 'value',
            fontSize: 35,
          },
          projection: mapObj.getView().getProjection().getCode() || 'EPSG:3857',
        }

        const layer = new contourLayer(mapObj, params)
        mapObj.addLayer(layer)
        await layer.loadGeojson(
          lineGeojson ,"normal"
        )
        
      }
